 else         if (deleted == getAmOrPmKeyCode(PM)) {
          deletedKeyStr=mPmText;
        }
 else {
          deletedKeyStr=String.format("%d",getValFromKeyCode(deleted));
        }
        Utils.tryAccessibilityAnnounce(mTimePicker,String.format(mDeletedKeyFormat,deletedKeyStr));
        updateDisplay(true);
      }
